@everyone  Welcome to our next data challenge initiative! 🤝 Here, we will use data science and ML to show where our beloved livestock meals come from. 

This challenge aims to understand how travel speed and external weather conditions affect heat and humidity within transport. It's an exciting expedition that uses IoT data and ML to de-risk high-value goods such as fruits, vegetables, pharmaceuticals, and livestock during transportation events.

The data is available and live to test. Develop the best solution, and your creativity is rewarded. Interested? Check out the details: https://bit.ly/3CFm1gl
